do a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 201 do ClienteController\n    E com ClienteDtoResponse no body, com id e nome \"Jim Highsmith\" e email \"jim@email.com\" e login \"highsmith\" e senha \"high123\" e numeroCartaoFidelidade \"1234-6666-004\"\n    E o Cliente cadastrado no banco de dados possui nome \"Jim Highsmith\" e email \"jim@email.com\" e login \"highsmith\" e senha \"high123\" e numeroCartaoFidelidade \"1234-6666-004\"\n\n  Cenario: Post para criar Cliente e Endereço, com sucesso, pelo ClienteController\n    Dado um ClienteDtoRequest e EnderecoDtoRequest, com nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\" e com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n    Quando a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 201 do ClienteController\n    E com ClienteDtoResponse no body, com id e nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\"\n    E com EnderecoDtoResponse no body, com id e cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n    E o Cliente cadastrado no banco de dados possui nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e numeroCartaoFidelidade \"1234-6666-013\"\n    E um Endereço salvo no database, com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n\n  Cenario: Post para criar Cliente, com erro por email não único, pelo ClienteController\n    Dado um ClienteDtoRequest, com nome \"Alistair Cockburnn\" e email \"mike@email.com\" e login \"alistair\" e senha \"12345\" e numeroCartaoFidelidade \"1234-6666-987\"\n    Quando a requisição Post for feita no método create do ClienteController\n    Entao receber ResponseEntity com HTTP 409 do     |\n      |  Martin Fowler    |   fowler2@email.com    |   mfowler   |   fowler123   |      null    |      null    |    null    |   gerente geral  |\n      |     Kent Beck     |     beck2@proton.me    |     kbeck   |     beck123   |      null    |      null    |    null    |     atendente    |\n      |  Jeff Sutherland  |     jeff2@gmail.com    |   jsuther   |   suther234   |      null    |      null    |    null    |     investidor   |\n      |    James Clear    |  jamesclear@gmail.com  |    jamesc   |    james12    |   78098-179  |     Rua L    |     300    |      contador    |\n      |    Ron Jeffries   |     ronj@gmail.com     |   jeffries  |   jeffries12  |   78098-800  |     Rua H    |     709    |       teste2     |\n      |     Eric Evans    |     eric@yahoo.com     |     evans   |    evans123   |   75666-908  |     Rua O    |     110    |       teste3     |\n      |  Scott Hanselman  |   hanselman@yahoo.com  |   hanselman |  hanselman123 |   66000-777  |    Rua HJ    |    2119    |        chef      |\n    Dado cadastros de Restaurantes disponíveis no banco de dados\n      |         nome        | tipoCozinhaEnum |  horaAbertura  |  horaFechamento |      cep     |  logradouro  |   numero   |     proprietario      |\n      | Churrasco da Ovelha |      ARABE      |    06:00:00    |     23:00:00    |   78324-125  |    Rua RF    |    1236    |  hanselman@yahoo.com  |\n\n  Cenario: Post para criar Proprietário, com sucesso, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Alistair Cockburn\" e email \"cock@email.com\" e login \"cockburn\" e senha \"cock12\" e descricao \"advogado\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 201 do ProprietarioController\n    E com ProprietarioDtoResponse no body, com id e nome \"Alistair Cockburn\" e email \"cock@email.com\" e login \"cockburn\" e senha \"cock12\" e descricao \"advogado\"\n    E o Proprietario cadastrado no banco de dados possui nome \"Alistair Cockburn\" e email \"cock@email.com\" e login \"cockburn\" e senha \"cock12\" e descricao \"advogado\"\n\n  Cenario: Post para criar Proprietario e Endereço, com sucesso, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest e EnderecoDtoRequest, com nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e descricao \"Toda quarta na empresa\" e com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 201 do ProprietarioController\n    E com ProprietarioDtoResponse no body, com id e nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e descricao \"Toda quarta na empresa\"\n    E com EnderecoDtoResponse no body, com id e cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\", pelo ProprietarioController\n    E o Proprietario cadastrado no banco de dados possui nome \"Geoffrey Blaney\" e email \"blaney@email.com\" e login \"blaney\" e senha \"blaney12\" e descricao \"Toda quarta na empresa\"\n    E um Endereço salvo no database, com cep \"23520-123\" e logradouro \"Rua Hermes Lima\" e número \"700\", pelo ProprietarioController\n\n  Cenario: Post para criar Proprietário, com erro por email não único, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"James Grenning\" e email \"jeff2@gmail.com\" e login \"grenning\" e senha \"12345\" e descricao \"Presente toda quinta-feira\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 409 do ProprietarioController\n\n  Cenario: Post para criar Proprietário, com erro por login não único, pelo ProprietárioController\n    Dado um ProprietarioDtoRequest, com nome \"Andrew Hunt\" e email \"hunt@email.com\" e login \"mfowler\" e senha \"12345\" e descricao \"Presente pela tarde\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 409 do ProprietarioController\n\n  Cenario: Post para criar Proprietário, com erro por nome não único, pelo ProprietárioController\n    Dado um ProprietarioDtoRequest, com nome \"Martin Fowler\" e email \"hunt@email.com\" e login \"ahunt\" e senha \"12345\" e descricao \"Trabalha pela manhã\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 409 do ProprietarioController\n\n  Cenario: Post para criar Proprietário, com erro por nome vazio, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"   \" e email \"hel@email.com\" e login \"helga\" e senha \"12345\" e descricao \"Visita a empresa quinzenalmente\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por nome maior, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"nome grande nome grande nome grande nome grande nome grande nome grande nome grande\" e email \"hel@email.com\" e login \"helga\" e senha \"12345\" e descricao \"Está na empresa pela manhã\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por email vazio, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \" \" e login \"helga\" e senha \"12345\" e descricao \"Trabalha como atendente\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por email incorreto, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \"helga.com\" e login \"helga\" e senha \"12345\" e descricao \"sócio-investidor\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por login vazio, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \"hel@email.com\" e login \"  \" e senha \"12345\" e descricao \"turno no período noturno\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por login maior, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \"hel@email.com\" e login \"helgaweiss.helgaweiss.helgaweiss.helgaweiss.helgaweiss\" e senha \"12345\" e descricao \"Contador da empresa\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por senha vazia, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \"hel@email.com\" e login \"helga\" e senha \"  \" e descricao \"Gerente de entregas\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n  Cenario: Post para criar Proprietario, com erro por senha maior, pelo ProprietarioController\n    Dado um ProprietarioDtoRequest, com nome \"Helga Weiss\" e email \"hel@email.com\" e login \"helga\" e senha \"anne01234567890123456789012345678901234567890123456789\" e descricao \"1234-6666-012\"\n    Quando a requisição Post for feita no método create do ProprietarioController\n    Entao receber ResponseEntity com HTTP 400 do ProprietarioController\n\n\n  Cenario: Get para consultar Proprietario, com sucesso, pelo ProprietarioController\n    Dado um identificador ID de um proprietario existente, com email \"fowler2@email.com\"\n    Quando uma requisição Get for feita no método findById do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E com ProprietarioDtoResponse no body, com id e nome \"Martin Fowler\" e email \"fowler2@email.com\" e login \"mfowler\" e senha \"fowler123\" e descricao \"gerente geral\"\n\n  Cenario: Get para consultar Proprietario não encontrado pelo ProprietarioController\n    Dado um identificador ID de um proprietario inexistente\n    Quando uma requisição Get for feita no método findById do ProprietarioController\n    Entao receber ResponseEntity com HTTP 404 do ProprietarioController\n\n\n  Cenario: Get para pesquisa paginada de Proprietario, com sucesso por um nome, pelo ProprietarioController\n    Quando uma requisição Get for feita, com nome \"James Clear\" no filtro, no método search do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E a resposta deve conter apenas proprietario, com nome \"James Clear\", no método search do ProprietarioController\n\n  Cenario: Get para pesquisa paginada de Proprietario, com sucesso por dois nomes, pelo ProprietarioController\n    Quando uma requisição Get for feita, com nome \"James Clear,Kent Beck\" no filtro, no método search do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E a resposta deve conter apenas proprietario, com nome \"James Clear,Kent Beck\", no método search do ProprietarioController\n\n  Cenario: Get para pesquisa paginada de Proprietario, com sucesso por dois emails, pelo ProprietarioController\n    Quando uma requisição Get for feita, com email \"jeff2@gmail.com,beck2@proton.me\" no filtro, no método search do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E a resposta deve conter apenas proprietarios, com email \"jeff2@gmail.com,beck2@proton.me\", no método search do ProprietarioController\n\n  Cenario: Get para pesquisa paginada de Proprietario, com sucesso por duas descricões, pelo ProprietarioController\n    Quando uma requisição Get for feita, com descricao \"atendente,contador\" no filtro, no método search do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E a resposta deve conter apenas proprietarios, com descricao \"atendente,contador\", no método search do ProprietarioController\n\n\n  Cenario: Put para atualizar Proprietario, com sucesso, pelo ProprietarioController\n    Dado um identificador ID de um proprietario existente, com email \"beck2@proton.me\"\n    E um ProprietarioDtoRequest, com nome \"Kent Beck Jr\" e email \"kbeck@proton.me\" e login \"kentbeck\" e senha \"kbeck12\" e descricao \"atendente chefe\"\n    Quando uma requisição Put for feita no método update do ProprietarioController\n    Entao receber ResponseEntity com HTTP 200 do ProprietarioController\n    E com ProprietarioDtoResponse no body, com id e nome \"Kent Beck Jr\" e email \"kbeck@proton.me\" e login \"kentbeck\" e senha \"kbeck12\" e descricao \"atendente chefe\"\n    E o Proprietario cadastrado no banco de dados possui nome \"Kent Beck Jr\" e email \"kbeck@proton.me\" e login \"kentbeck\" e senha \"kbeck12\" e descricao \"atendente chefe\"\n\n  Cenario: Put para atualizar Proprietario não encontrado pelo ProprietarioController\n    Dado um identificador ID de um proprietario inexistente\n    E um ProprietarioDtoRequest, com nome \"Viktor Frankl\" e email \"vik@email.com\" e login \"viktor\" e senha \"vikt1\" e descricao \"É o contador da empresa\"\n    Quando uma requisição Put for feita no método update do ProprietarioController\n    Entao receber ResponseEntity com b34a752","testStepResult":{"duration":{"seconds":0,"nanos":207377},"status":"PASSED"},"timestamp":{"seconds":1750416141,"nanos":472383356}}},{"testCaseFinished":{"testCaseStartedId":"71f27ed6-5a82-430a-a05b-34c9d39aafce","timestamp":{"seconds":1750416141,"nanos":472493425},"willBeRetried":false}},{"source":{"uri":"classpath:features\/restaurante.feature","data":"# language: pt\nFuncionalidade: testar operações Create\/POST, Read\/GET, Update\/PUT e Delete\/DELETE\n  Como Usuário dessa API Rest, desejo cadastrar, consultar, atualizar e deletar Restaurante\n  Dessa forma, ter respostas padrão de sucesso ou de erro\n  Para saber se meu sistema foi capaz de executar um CRUD de Restaurante\n\n  Contexto:\n    Dado ambiente de teste ativado para Restaurante de Challenge_User\n    Dado cadastros de Clientes disponíveis no banco de dados para RestauranteController\n      |       nome        |         email         |    login     |    senha      |  numeroCartaoFidelidade  |\n      |   Isaac Newton    |    newton@email.com   |    newton    |   newton123   |     8000-5555-000        |\n      |  Albert Einstein  |   einstein@proton.me  |   einstein   |  einstein123  |     8001-5555-011        |\n    Dado cadastros de Proprietários disponíveis no banco de dados para RestauranteController\n      |       nome        |         email         |    login     |    senha      |  descricao  |\n      |  Stephen Hawking  |    hawking@yahoo.com  |    hawking   |   hawking123  |   Teste0    |\n      |     Sócrates      |   socrates@yahoo.com  |   socrates   |  socrates123  |   Teste1    |\n      |      Platão       |    platao@yahoo.com   |    platao    |   platao123   |   Teste2    |\n      |    Aristóteles    | aristoteles@yahoo.com |  aristoteles | aristoteles12 |   Teste3    |\n      |  Galileu Galilei  |    galilei@yahoo.com  |    galilei   |   galilei123  |   Teste4    |\n      |     Niels Bohr    |      bohr@yahoo.com   |     bohr     |    bohr123    |   Teste5    |\n    Dado cadastros de Restaurantes disponíveis no banco de dados\n      |         nome        | tipoCozinhaEnum |  horaAbertura  |  horaFechamento  |      cep     |  logradouro  |   numero   |     proprietario      |\n      |    Casa do Porco    |    CARNIVORA    |    08:00:00    |     12:00:00     |   78008-009  |    Rua GH    |    1506    |   hawking@yahoo.com   |\n      |      Coco Bambu     |     CHINESA     |    09:00:00    |     22:00:00     |   78511-876  |    Rua BN    |    2234    |  socrates@yahoo.com   |\n      |        Fasano       |      TURCA      |    08:30:00    |     20:30:00     |   78689-123  |    Rua MS    |    3349    |   platao@yahoo.com    |\n      |        D.O.M        |     VEGANA      |    10:00:00    |     18:00:00     |   78543-400  |    Rua DG    |    1201    | aristoteles@yahoo.com |\n\n  Cenario: Post para criar Restaurante e Endereço, com sucesso, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"Arturito\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"07:30:30\" e horaFechamento \"18:30:30\", e EnderecoDtoRequest, com cep \"25444-222\" e logradouro \"Rua Avelino Popo\" e número \"550\",e Proprietario, com email \"galilei@yahoo.com\"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 201 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Arturito\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"07:30:30\" e horaFechamento \"18:30:30\"\n    E com EnderecoDtoResponse no body, com id e cep \"25444-222\" e logradouro \"Rua Avelino Popo\" e número \"550\", pelo RestauranteController\n    E com Proprietario no body, com email \"galilei@yahoo.com\"\n    E o Restaurante cadastrado no banco de dados possui nome \"Arturito\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"07:30:30\" e horaFechamento \"18:30:30\"\n    E um Endereço salvo no database, com cep \"25444-222\" e logradouro \"Rua Avelino Popo\" e número \"550\", pelo RestauranteController\n\n  Cenario: Post para criar Restaurante e Endereço, com erro por Proprietario not found, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"Casa das Aves\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"11:30:30\" e horaFechamento \"17:00:30\", e EnderecoDtoRequest, com cep \"90788-500\" e logradouro \"Rua Aves\" e número \"400\",e Proprietario, com Id inexistente\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n  Cenario: Post para criar Restaurante e Endereço, com erro por Id de Cliente como Proprietario, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"Churrascaria do Boi\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"11:10:10\" e horaFechamento \"17:10:10\", e EnderecoDtoRequest, com cep \"78000-550\" e logradouro \"Rua do Boi\" e número \"400\",e Proprietario, com email \"newton@email.com\"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n  Cenario: Post para criar Restaurante e Endereço, com erro por nome vazio, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"   \" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"11:20:20\" e horaFechamento \"17:20:20\", e EnderecoDtoRequest, com cep \"25444-222\" e logradouro \"Rua Avelino Popo\" e número \"550\",e Proprietario, com email \"galilei@yahoo.com\"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 400 do RestauranteController\n\n  Cenario: Post para criar Restaurante e Endereço, com erro por horaAbertura posterior horaFechamento, pelo RestauranteController\n    Dado um RestauranteDtoRequest, com nome \"Churros de Mel\" e tipoCozinhaEnum \"MEXICANA\" e horaAbertura \"18:20:20\" e horaFechamento \"08:20:20\", e EnderecoDtoRequest, com cep \"25444-222\" e logradouro \"Rua Avelino Popo\" e número \"550\",e Proprietario, com email \"galilei@yahoo.com\"\n    Quando a requisição Post for feita no método create do RestauranteController\n    Entao receber ResponseEntity com HTTP 409 do RestauranteController\n\n\n  Cenario: Put para atualizar Restaurante e Endereço, com sucesso, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Fasano\"\n    E um RestauranteDtoRequest, com nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\", e EnderecoDtoRequest, com cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\",e Proprietario, com email \"bohr@yahoo.com\"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 200 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\"\n    E com EnderecoDtoResponse no body, com id e cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\", pelo RestauranteController\n    E o Restaurante cadastrado no banco de dados possui nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\"\n    E um Endereço salvo no database, com cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\", pelo RestauranteController\n\n  Cenario: Put para atualizar Proprietario do Restaurante e Endereço, com sucesso, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Fasano\"\n    E um RestauranteDtoRequest, com nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\", e EnderecoDtoRequest, com cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\",e Proprietario, com email \"bohr@yahoo.com\"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 200 do RestauranteController\n    E com RestauranteDtoResponse no body, com id e nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\"\n    E com EnderecoDtoResponse no body, com id e cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\", pelo RestauranteController\n    E com Proprietario no body, com email \"bohr@yahoo.com\"\n    E o Restaurante cadastrado no banco de dados possui nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:40:40\" e horaFechamento \"18:40:40\"\n    E um Endereço salvo no database, com cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\", pelo RestauranteController\n\n  Cenario: Put para atualizar Restaurante e Endereço, com erro por Id de Cliente como Proprietario, pelo RestauranteController\n    Dado um identificador ID de um Restaurante existente, com nome \"Fasano\"\n    E um RestauranteDtoRequest, com nome \"Fasano Bovino\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:55:55\" e horaFechamento \"18:55:55\", e EnderecoDtoRequest, com cep \"78000-550\" e logradouro \"Rua do Boi\" e número \"400\",e Proprietario, com email \"newton@email.com\"\n    Quando uma requisição Put for feita no método update do RestauranteController\n    Entao receber ResponseEntity com HTTP 404 do RestauranteController\n\n  Cenario: Put para atualizar Restaurante, com erro not found, pelo RestauranteController\n    Dado um identificador ID de um Restaurante inexistente\n    E um RestauranteDtoRequest, com nome \"Fasano Atualizado\" e tipoCozinhaEnum \"CHILENA\" e horaAbertura \"10:55:55\" e horaFechamento \"18:55:55\", e EnderecoDtoRequest, com cep \"11333-444\" e logradouro \"Rua Fasano Central\" e número \"56\",e Proprietario, com email \"bohr@yahoo.com\"\n    Quando uma requisição Put for feita no métod
